        mHdltvinHandle << " , " <<  " \"dither_q0\" :  \"" << dither_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dither_address1\" :  \"" << dither_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dither_ce1\" :  \"" << dither_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dither_q1\" :  \"" << dither_q1.read() << "\" ";
